import React from "react";

const projects = [
  {
    title: "E-Commerce Website",
    description: "Developed a full-stack e-commerce site with authentication, cart, and payment features.",
    technologies: "React, Node.js, MongoDB, Stripe API",
  },
  {
    title: "Task Manager App",
    description: "A simple to-do app that allows users to create, update, and delete tasks with Firebase storage.",
    technologies: "React, Firebase, Bootstrap",
  },
  {
    title: "Portfolio Website",
    description: "A personal portfolio website showcasing my work, skills, and projects.",
    technologies: "React, Bootstrap, Netlify",
  }
];

function Projects() {
  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">My Projects</h1>
      <div className="row">
        {projects.map((project, index) => (
          <div key={index} className="col-md-4">
            <div className="card shadow-sm mb-4">
              <div className="card-body">
                <h5 className="card-title">{project.title}</h5>
                <p className="card-text">{project.description}</p>
                <p><strong>Tech Used:</strong> {project.technologies}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Projects;
